COPY start_here_info (info_id, sort_order, is_webcompatible, solution_name, file_name, overview, item_name, image, thumbnail, unique_features, how_to_use) FROM stdin;
1	1	1	_START_HERE	_START_HERE.servoy	The purpose of this solution is to give you an overview of the example files that we have included to help you get more familiar with Servoy.	Getting Started With Servoy	\N	\N	\N	This solution lists the sample solutions (on the left side) - which may or may not be installed (depending on the options you chose at install time). The samples can be checked out,  after install is finished.  To do that, right-click "All Solutions" in Solution Explorer view, then select "Checkout", press "Next" in the dialog that opens. A dialog with a list of solutions should appear, expand the node of the solution you want to install, select "Head" and then press "Finish" button.  If you've imported the solution into the same repository that the application server is pointed to (connect to <font color="blue"> <u>http://yourIPaddress:8080/servoy-admin</u></font> to find out) - then all the clients on your network will have access to the solution as well.  You can view the methods behind any of the objects in a solution (or behind any event) by choosing "Editor" from the "Tools" menu, then click on the form name. You'll see a list of methods - and just double-click them to view the contents.  Here's a couple of tips when you're exploring the various solutions: <ul> <li>Go into designer mode - and when you want to navigate a form that's in a tabpanel, simply double click the tab.</li> <li>To view the method that a button fires (usually attached to the "onAction" property of an object) - hold down the CONTROL key and double-click the method name in the properties palette.</li> <li>If you're in Servoy Developer - there are two green buttons to the far right in the toolbar - one to launch the current solution in the Smart Client <img src='media:///launchSmartClient.gif' border=0> and one that will launch the solution in a browser <img src='media:///launchWebClient.gif' border=0></li> </ul>
2	2	1	servoy_sample_crm	servoy_sample_crm.servoy	This solution functions as a basic CRM (Customer Relationship Management) solution - providing a place to enter and keep track of Customers, Contacts, Products and Orders.   This solution is <b>Web Client compatible!</b>	Sample CRM 5.x	\\	\\	This solution features techniques that you can use when designing your own applications that can function in both the Smart Client and the Web Client.  The "dialog" in the tabpanel is probably the most unique feature of this solution. Since the Smart Client supports putting a form into a dialog box and the 5.x Web Client in 5.x doesn't - by using a hidden tabpanel and showing it - we can simulate a "dialog" - even in the Web Client.  Another interesting technique used in this solution is the buttons in the upper left (New, Edit, Delete, Print). They are on their own separate form and are used on all other forms as a tabless tabpanel. If you look at the methods behind the buttons, they're a great example on how to create navigation or editing buttons ONCE in a solution - rather than on every single form.  On the tab that shows the Top 5 Sales Items ("Customers" section) - Servoy is actually performing a custom SQL query to get the top 5 ordered items, then passes the values off to a charting JavaBean that then draws the result. Try clicking the "Next" and "Previous" buttons and you can see the data change in real-time.	Open up the solution and click through it. You'll see that there is basic functionality for displaying lists in a tabpanel, including icons that change depending on the selected record, basic record navigation, and much more. Feel free to enhance or change anything in the solution!
3	3	1	servoy_sample_pdf_forms	servoy_sample_pdf_forms.servoy	This Servoy solution allows you to store PDF fill-in forms inside the database, and then fill out the form (using Adobe Acrobat in a web browser) and the data will be automatically stored inside the backend database.\n\nThis solution is also <b>Web Client compatible!</b>	PDF Forms Example	\\	\\	With our FREE PDF Forms plug-in - it's never been easier to allow your users to fill out PDF forms and capture the data back into your database - WITHOUT programming.\n\nServoy uses Web Services to open up the PDF Template stored in the database in Acrobat Reader (in a browser window). Then, it uses Web Services to send the data back to the backend database - all without the need to do any programming.\n\nEven if your form changes - as long as the field NAMES themselves don't change - then Servoy will automatically fill out the form with the previously entered data.	Make sure you have one or more PDF forms with fields on them (commonly called "fill-in forms"). You can then add them into the database using the "PDF Templates" section. Once you have one or more templates loaded, you are now ready to fill out the forms. \n\nTo create or update PDF Templates:<ul>\n<li>Click "PDF Templates" in the lower left "Navigation" area</li>\n<li>Click the "Add" button in the upper right</li>\n<li>Give the form a name (this is what will show up in the list)</li>\n<li>Optionally assign a category</li>\n<li>Click the "+" button to the right of "File Name" to choose the PDF Template from your hard drive</li>\n<li>Optionally fill in a description</li>\n<li>Click the "Save" button in the upper right of the screen</li>\n</ul>\nOnce you have the template, you can create multiple filled out "instances" of that template. These are referred to in this solution as "PDF Forms." You can have as many Forms as you want from as many different templates as  you want.\n\nTo begin creating PDF Forms:<ul>\n<li>Click "PDF Forms" in the lower left "Navigation" area</li>\n<li>Click the "Add" button in the upper right</li>\n<li>Choose a form from the pop-up menu</li>\n<li>Click the "Save" button in the upper right of the screen</li>\n<li>Click the "Edit the Form's Values" button</li>\n</ul>\n
4	4	\N	servoy_sample_simpleChat	servoy_sample_simpleChat.servoy	SimpleChat is just what its name says - a very simple chat program that is meant for LAN users (only). This solution was created to show off the UDP (User Datagram Protocol) plug-in. UDP allows you to send data (text, integers, and binary data) to any other IP address.	Sample Chat Application	\\	\\	\N	When you first open the solution - set your login name, and click the "Login" button (or press enter). You will then be able to choose another user from the list. Once you've chosen a person, use the message text at the bottom of the screen to type in a message (and press enter or return).\n\nIf you are chatting with someone, and want to send someone ELSE a message, then type in one or more characters of that person's login name followed by a colon (:) and then the message. \n\nFor example, if I were chatting with Jane, but wanted to send "Sam" a quick message I would type: S: and then my message.\n\nWhen you're done chatting click the "Logout" button or close the solution.\n
5	5	\N	servoy_sample_treeControl	servoy_sample_treeControl.servoy	This example file was created to show how to use JavaBeans from within Servoy. The example uses two different JavaBeans - the "DBTreeView" and the "JSplitPane."\n\nThe DBTreeView JavaBean allows you to display a folder-like listing of whatever data you want, while the JSplitPane bean allows you to create resizable panels.	Tree Bean & Resize Bean	\\	\\	This example file is marked as a "module" (in File -  Solution Settings)  so that it won't show up in the Smart Client "Open" dialog, nor in the Web Client list of available solutions.  Modules are simply solutions that can be used by multiple solutions.	When you open the solution you'll notice that there are 3 different panes: "Text", "Comment" and "Note". Click and hold on the dividing line between Text and Comment and resize it. Notice how you can do the same thing with the horizontal pane Notes. When you close and re-open the solution the panes will be reset back to their default locations. If you use this bean in your own solution, you might want to think about storing the sizes of each pane so you can restore it for each user.\n\nTo see the DBTreeView in action click on the "+" node next to "Dead Men Tell No Tales" to open the selection. You can then click any of the nodes to display the information.
7	\N	\N	Solution Model	servoy_sample_solutionModel.servoy	This sample shows the flexibility of the Servoy solutionModel (solution blueprint creation/modification) together with client design functionallity.	Sample Solution Model	\N	\\	\N	You can use any name/password to login, when the same login name is used in subsequential logins, changes done with client design will be shown in the detail forms. (a subsequential login is possible via 'logout" menu action or new browser start incase of webclient).The solution will create list and detail forms on the fly, based upon a database description, which can be configured.\nThe configuration takes place in the configure mode (is an aministrator function), which tells what an enduser can see, how forms should be looking, etc. (the configuration mode can be left by clicking Edit)\n\nThe client design functionallity can be seen in action in the detail forms.
8	\N	\N	servoy_sample_styles	servoy_sample_styles.servoy	The solution shows how the use of styles changes the appearance of different form elements.	Sample Styles	\N	\\	\N	Activate the solution and change the style using the combobox in the upper right part of the form, to select different styles. Use the buttons to the left and right of the combobox to select the next style.
